import React, { Component } from 'react'
import {motion,AnimatePresence} from 'framer-motion';

export default class Lobby extends Component {
    
    
    render() {
        return (
            <div className="waiting-lobby" >
                <h5>Waiting for someone to join</h5>
                <motion.div
                    
                    variants={this.loadingContainerVariants}
                    initial="start"
                    animate="end"
                    >
                    <motion.span
                        
                        variants={this.loadingCircleVariants}
                        transition={this.loadingCircleTransition}
                    />
                    <motion.span
                        
                        variants={this.loadingCircleVariants}
                        transition={this.loadingCircleTransition}
                    />
                    <motion.span
                        
                        variants={this.loadingCircleVariants}
                        transition={this.loadingCircleTransition}
                    />
                    </motion.div>
                
            </div>
        )
    }
}
